            case CRITICALEXTNS_CRITICALEXTNSFUTURE :
                CMCHKPK(cmPkNhuUERadioAccessCapInfocriticalExtnscriticalExtnsFuture, &param->val.criticalExtnsFuture, mBuf); 
                break;
            case CRITICALEXTNS_C24 :
